import adminConfig from './admin';
import Utils from '@/sys/utils/util';
import projectRouter from './project';
import dictRouter from './dict';
import worktimeRouter from './worktime';
let homeRouter = [
  {
    title: '项目简介',
    type: 'view',
    name: Symbol('about'),
    route: '/about',
    filePath: 'views/about/About.vue',
    inNav: true,
    icon: 'iconfont icon-iconset0103',
    order: 0,
  },
  {
    title: '日志管理',
    type: 'view',
    name: Symbol('log'),
    route: '/log',
    filePath: 'views/log/Log.vue',
    inNav: true,
    icon: 'iconfont icon-rizhiguanli',
    order: 1,
    permission: ['查询所有日志'],
  },
  {
    title: '个人中心',
    type: 'view',
    name: Symbol('center'),
    route: '/center',
    filePath: 'views/center/Center.vue',
    inNav: false,
    icon: 'iconfont icon-rizhiguanli',
  },
  {
    title: '404',
    type: 'view',
    name: Symbol('404'),
    route: '/404',
    filePath: 'views/error-page/404.vue',
    inNav: false,
    icon: 'iconfont icon-rizhiguanli',
  },
  adminConfig,
  projectRouter,
  dictRouter,
  worktimeRouter
];

const plugins = [];

// 筛除已经被添加的插件
function filterPlugin(data) {
  if (plugins.length === 0) {
    return;
  }
  if (Array.isArray(data)) {
    data.forEach(item => {
      filterPlugin(item);
    });
  } else {
    const findResult = plugins.findIndex(item => data === item);
    if (findResult >= 0) {
      plugins.splice(findResult, 1);
    }
    if (data.children) {
      filterPlugin(data.children);
    }
  }
}

filterPlugin(homeRouter);

homeRouter = homeRouter.concat(plugins);

// 处理顺序
homeRouter = Utils.sortByOrder(homeRouter);

// 使用 Symbol 处理 name 字段, 保证唯一性
const deepReduceName = target => {
  if (Array.isArray(target)) {
    target.forEach(item => {
      if (typeof item !== 'object') {
        return;
      }
      deepReduceName(item);
    });
    return;
  }
  if (typeof target === 'object') {
    if (typeof target.name !== 'symbol') {
      // eslint-disable-next-line no-param-reassign
      target.name = target.name || Utils.getRandomStr();
      // eslint-disable-next-line no-param-reassign
      target.name = Symbol(target.name);
    }

    if (Array.isArray(target.children)) {
      target.children.forEach(item => {
        if (typeof item !== 'object') {
          return;
        }
        deepReduceName(item);
      });
    }
  }
};

deepReduceName(homeRouter);

export default homeRouter;
